function StudentList(){}StudentList.prototype.listenDelEvent=function(){$(".del-btn").click(function(t){t.preventDefault();var n=$(this).attr("data-student-id"),e=$(this).attr("data-student-name");acalert.alertConfirm({msg:"确定要开除"+e+"吗?",confirmCallback:function(){acajax.post({url:"/student/del_student_school/",data:{student_id:n},success:function(t){acalert.alertSuccess({title:"欧耶~",msg:"恭喜你毁了"+e+"的未来！TA辍学了！",confirmCallback:function(){window.location.reload()}})}})}})})},StudentList.prototype.run=function(){this.listenDelEvent()},$(function(){(new StudentList).run()});